                           <!-- <fieldset>\r\n                                      <div class=\"input-group\">\r\n                                        <input type=\"number\" class=\"form-control\" id=\"ruleVal\" [(ngModel)]=\"loyaltyDetails.ruleVal\" formControlName=\"ruleVal\" min=\"0\" required>\r\n                                        <div class=\"input-group-append\">\r\n                                          <span class=\"input-group-text\">%</span>\r\n                                        </div>\r\n                                      </div>\r\n                                    </fieldset> -->\r\n\r\n                                    <!-- <small class=\"form-text text-muted danger\" *ngIf=\"!loyaltyform.get('ruleVal').valid && (loyaltyform.get('ruleVal').dirty || loyaltyform.get('ruleVal').touched)\">Percentage is required!</small> -->\r\n                                </div>\r\n                              </div>\r\n                              <div class=\"col-md-6\" *ngIf = \"absolute\">\r\n                                <div class=\"form-group\">\r\n                                    <label for=\"points\">Points</label>\r\n                                    <input type=\"number\" class=\"form-control\" id=\"ruleVal\" [(ngModel)]=\"loyaltyDetails.ruleVal\" formControlName=\"ruleVal\" min=\"0\" oninput=\"this.value = Math.abs(this.value)\">\r\n                                    <!-- <small class=\"form-text text-muted danger\" *ngIf=\"!loyaltyform.get('ruleVal').valid && (loyaltyform.get('ruleVal').dirty || loyaltyform.get('ruleVal').touched)\">Absolute is required!</small> -->\r\n                                </div>\r\n                              </div>\r\n                              <div class=\"col-md-6\" *ngIf = \"eventBased\">\r\n                                <div class=\"form-group\">\r\n                                    <label for=\"points\">Event</label>\r\n                                    <div class=\"input-group\">\r\n                                      <select class=\"custom-select mb-2\" formControlName=\"ruleVal\" [(ngModel)]=\"loyaltyDetails.ruleVal\">\r\n                                        <option disabled=\"true\">Select Event</option>\r\n                                        <option *ngFor=\"let eve of event\" value=\"{{eve}}\">{{eve}}</option>\r\n                                      </select>\r\n                                    </div>\r\n                                    <!-- <small class=\"form-text text-muted danger\" *ngIf=\"!loyaltyform.get('ruleVal').valid && (loyaltyform.get('ruleVal').dirty || loyaltyform.get('ruleVal').touched)\">Percentage is required!</small> -->\r\n                                </div>\r\n                              </div>\r\n                              <div class=\"col-md-6\" *ngIf = \"referral\">\r\n                                <div class=\"form-group\">\r\n                                    <label for=\"points\">Who gets the Reward?</label>\r\n                                    <div class=\"input-group\">\r\n                                      <select class=\"custom-select mb-2\" formControlName=\"ruleVal\" [(ngModel)]=\"loyaltyDetails.ruleVal\" (change)=\"referralType($event.target.value)\">\r\n                                        <option disabled=\"true\">Select Type</option>\r\n                                        <option value=\"referer\">Referer</option>\r\n                                        <option value=\"referee\">Referee</option>\r\n                                        <option value=\"both\">Both</option>\r\n                                      </select>\r\n                                    </div>\r\n                                </div>\r\n                              </div>\r\n                              <div class=\"col-md-6\" *ngIf = \"refValue == 'both'\">\r\n                                <div class=\"form-group\">\r\n                                    <label for=\"referer\">Referer</label>\r\n                                    <div class=\"input-group\">\r\n                                      <input type=\"text\" class=\"form-control\" id=\"Referer\" [(ngModel)]=\"loyaltyDetails.referer\" formControlName=\"referer\" required>\r\n                                    </div>\r\n                                </div>\r\n                              </div>\r\n                            </div>\r\n                          </div>\r\n\r\n                          <div class=\"form-body\">\r\n                            <div class=\"row\">\r\n                              <div class=\"col-md-6\" *ngIf = \"refValue == 'both'\">\r\n                                <div class=\"form-group\">\r\n                                    <label for=\"referee\">Referee</label>\r\n                                    <div class=\"input-group\">\r\n                                      <input type=\"text\" class=\"form-control\" id=\"Referee\" [(ngModel)]=\"loyaltyDetails.referee\" formControlName=\"referee\" required>\r\n                                    </div>\r\n                                </div>\r\n                              </div>\r\n                            </div>\r\n                          </div>\r\n\r\n\r\n\r\n                          <h4 class=\"form-section\">Actions</h4>\r\n\r\n                          <div class=\"form-body\">\r\n                            <div class=\"row\">\r\n                              <div class=\"col-md-6\">\r\n                                <div class=\"form-group\">\r\n                                    <label for=\"name\">Rule Name</label>\r\n\r\n                                    <input type=\"text\" class=\"form-control\" id=\"name\" [(ngModel)]=\"loyaltyDetails.name\" formControlName=\"name\" required>\r\n                                    <small class=\"form-text text-muted danger\" *ngIf=\"!loyaltyform.get('name').valid && (loyaltyform.get('name').dirty || loyaltyform.get('name').touched)\">Name is required!</small>\r\n                                </div>\r\n                              </div>\r\n                              <div class=\"col-md-6\">\r\n                                <div class=\"form-group\">\r\n                                    <label for=\"name\">Rule Description</label>\r\n\r\n                                    <input type=\"text\" class=\"form-control\" id=\"description\" [(ngModel)]=\"loyaltyDetails.description\" formControlName=\"description\" required>\r\n                                    <small class=\"form-text text-muted danger\" *ngIf=\"!loyaltyform.get('description').valid && (loyaltyform.get('description').dirty || loyaltyform.get('description').touched)\">Description is required!</small>\r\n                                </div>\r\n                              </div>\r\n                            </div>\r\n                          </div>\r\n\r\n                          <div class=\"form-body\">\r\n                            <div class=\"row\">\r\n                              <!-- <div class=\"col-md-6\">\r\n                                <div class=\"form-group\">\r\n                                    <label for=\"points\">Points</label>\r\n                                    <input type=\"number\" class=\"form-control\" id=\"points\" [(ngModel)]=\"loyaltyDetails.points\" formControlName=\"points\" min=\"0\" oninput=\"this.value = Math.abs(this.value)\" required>\r\n                                    <small class=\"form-text text-muted danger\" *ngIf=\"!loyaltyform.get('points').valid && (loyaltyform.get('points').dirty || loyaltyform.get('points').touched)\">Points are required!</small>\r\n                                </div>\r\n                              </div> -->\r\n                              <div class=\"col-md-6\">\r\n                                <div class=\"form-group\">\r\n                                    <label for=\"maxpoints\">Max Points(If Any)</label>\r\n                  